import React, { useState, useEffect, useCallback } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  Link,
  useNavigate,
  useParams,
} from "react-router-dom";
import { QueryClient, QueryClientProvider, useQuery, useMutation, useQueryClient } from "react-query";
import { Toaster, toast } from "react-hot-toast";
import StudyApplicants from "./pages/StudyApplicants";
import StudyDetail from "./pages/StudyDetail";
import { GOOGLE_CLIENT_ID } from "./config";
import Header from "./components/Layout/Header";
import { AuthProvider, useAuth } from "./contexts/AuthContext";
import RequestFormBuilder from "./components/RequestFormBuilder";
import { postAPI } from "./services/api";
import StudySessions from "./components/StudySessions";
import MyInvites from "./components/MyInvites";
import MyParticipatingStudies from "./components/MyStudies";
import MyCreatedStudies from "./components/MyCreatedStudies";
import { RequestForm } from "./types";

// Google OAuth 타입 정의
declare global {
  interface Window {
    google: {
      accounts: {
        id: {
          initialize: (config: any) => void;
          prompt: () => void;
        };
      };
    };
  }
}

// Add basic types to fix TypeScript errors
interface User {
  id: number;
  username: string;
  email: string;
  role?: string;
  provider?: string;
}

interface StudySession {
  id: number;
  title: string;
  description: string;
  recruitNumber: number;
  currentNumber: number;
  studyStatus: string;
  author: User;
  createdAt: string;
  updatedAt: string;
  category: string;
  mode: string;
  location?: string;
  isClosed: boolean;
  members?: StudyMember[];
  role?: string; // 추가: 사용자의 역할 (leader/member)
  joinedAt?: string; // 추가: 참여한 날짜
}

interface StudyApplication {
  id: number;
  applicant: User;
  post: {
    id: number;
    title: string;
    description: string;
    author: User;
    studyStatus: string;
    recruitNumber: number;
    currentNumber: number;
  };
  answers: any;
  isAccepted: boolean;
  isRejected: boolean;
  appliedAt: string;
}

interface StudyMember {
  id: number;
  userId: number;
  postId: number;
  role: string;
  joinedAt: string;
  user: User;
}

const queryClient = new QueryClient();

// ApplicationForm 컴포넌트 - 임시로 완전 차단
const ApplicationForm = ({
  questions,
  onSubmit,
  onCancel,
  loading = false,
}: {
  questions: any[];
  onSubmit: (values: any) => void;
  onCancel: () => void;
  loading?: boolean;
}) => {
  // 임시로 완전 차단
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-6 w-full max-w-2xl max-h-[90vh] overflow-y-auto">
        <h2 className="text-xl font-bold mb-4">스터디 지원서</h2>
        <div className="text-center py-8">
          <p className="text-gray-500 mb-4">임시로 비활성화되었습니다.</p>
          <div className="flex justify-end space-x-3">
            <button
              type="button"
              onClick={onCancel}
              className="px-4 py-2 text-gray-600 border border-gray-300 rounded-md hover:bg-gray-50"
            >
              취소
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

const LoginForm = () => {
  const { login, loginWithGoogle, loading } = useAuth();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  useEffect(() => {
    const initializeGoogleOAuth = () => {
      if (window.google && window.google.accounts && window.google.accounts.id) {
        try {
          window.google.accounts.id.initialize({
            client_id: GOOGLE_CLIENT_ID,
            callback: handleGoogleCredential,
            auto_select: false,
            cancel_on_tap_outside: true,
          });
        } catch (error) {
          console.error('Google OAuth 초기화 오류:', error);
        }
      } else {
        setTimeout(initializeGoogleOAuth, 1000);
      }
    };

    const waitForGoogleScript = () => {
      if (window.google && window.google.accounts && window.google.accounts.id) {
        initializeGoogleOAuth();
        return;
      }

      // Wait for the script to load from HTML head
      const checkInterval = setInterval(() => {
        if (window.google && window.google.accounts && window.google.accounts.id) {
          clearInterval(checkInterval);
          initializeGoogleOAuth();
        }
      }, 100);
    };

    waitForGoogleScript();
  }, []);

  const handleGoogleCredential = (response: any) => {
    if (response.credential) {
      loginWithGoogle(response.credential);
    }
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Login form submitted');
    console.log('Email:', email);
    console.log('Password:', password);
    try {
      await login(email, password);
      console.log('Login successful');
      console.log('Redirecting to home page...');
      // 로그인 성공 후 홈페이지로 이동
      window.location.href = '/';
    } catch (error) {
      console.error('Login failed:', error);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-md w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">
            StudyGroup에 로그인
          </h2>
          <p className="mt-2 text-center text-sm text-gray-600">
            또는{" "}
            <Link
              to="/register"
              className="font-medium text-indigo-600 hover:text-indigo-500"
            >
              새 계정 만들기
            </Link>
          </p>
        </div>
        <form className="mt-8 space-y-6" onSubmit={(e) => {
          console.log('Form onSubmit triggered');
          handleSubmit(e);
        }}>
          <div className="rounded-md shadow-sm -space-y-px">
            <div>
              <input
                type="email"
                required
                autoComplete="off"
                className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-t-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
                placeholder="이메일 주소"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div>
              <input
                type="password"
                required
                autoComplete="new-password"
                className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-b-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
                placeholder="비밀번호"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
          </div>

          <button
            type="submit"
            disabled={loading}
            onClick={() => console.log('Login button clicked')}
            className="group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 disabled:opacity-50"
          >
            {loading ? "로그인 중..." : "로그인"}
          </button>

          <div className="relative my-6">
            <div className="absolute inset-0 flex items-center">
              <div className="w-full border-t border-gray-300" />
            </div>
            <div className="relative flex justify-center text-sm">
              <span className="px-2 bg-gray-50 text-gray-500">또는</span>
            </div>
          </div>

          <button
            type="button"
            onClick={() => {
              if (window.google && window.google.accounts && window.google.accounts.id) {
                try {
                  window.google.accounts.id.prompt();
